public class _389FindtheDifference{


public static void main(String[] args) {

    String s=  "";
    String t = "";

   
    System.out.println(findTheDifference(s, t));
}

    public static  char findTheDifference(String s, String t) {
        
        
        int [] mapt = new int[26];

        int [] maps = new int[26];
        
        for(int i =0;i<t.length();i++){
            char cc = t.charAt(i);
            int idx = cc -'a';
            mapt[idx]+=1;
        }


        for(int i =0;i<s.length();i++){
            char cc = s.charAt(i);
            int idx = cc -'a';
            maps[idx]+=1;
        }

        for (int i = 0; i < mapt.length; i++) {
            System.out.print(mapt[i]+" ");
        }

        System.out.println();


        for (int i = 0; i < maps.length; i++) {
            System.out.print(maps[i]+" ");
        }
        
        
        for(int i =0;i<s.length();i++){
            char cc = t.charAt(i);
            int idx = cc -'a';
            mapt[idx]-=1;
        }
        
        
        // for(int i =0; i<map.length; i++){
        //     if(map[i]==1) {
        //         return (char)(i+'a');
        //     }
        // }
        
        return '*';
        
        
    }
}